export const obtenerAsuntos = async() => {
    const response = await fetch("http://192.168.64.4/php/asuntos.php", {
        headers: {
            'Content-Type': 'application/json',
            'Accept': 'application/json',
            'Access-Control-Allow-Origin': '*',
            'Access-Control-Allow-Methods': 'GET, POST, PUT, DELETE'
        }
    });
    const data = await response.json();
    return data;
}


export const getAllEpisodes = async (serieId) => {
    const response = await fetch(`http://api.tvmaze.com/shows/${serieId}/episodes`);
    const data = await response.json();
    return data;
} 

export const getSeries = () => {
    return [
        {
            name: "Friends",
            id: 431
        },
        {
            name: "Dragon Ball Z",
            id: 2103
        },
        {
            name: "Game of Thrones",
            id: 82
        }
    ];
};
